рмленные разделы для отображения всей необходимой информации. Слайдер во всю ширину сайта обеспечивает великолепное отображение изображений, связанных с вашим продуктовым магазином. В этой теме WP Grocery Store WordPress Theme также предусмотрены настройки слайдера. Имеется множество вариантов оформления боковых панелей. Нижний колонтитул также может быть отредактирован и оснащен виджетами, поскольку в тему включено множество виджетов.','Premium Theme Information'=>'Информация о премиум теме',' Once you are done with this, then follow the'=>' Как только вы закончите с этим, сделайте следующее','Select the option of Static Page, now select the page you created to be the homepage, while another page to be your default page.'=>'Выберите вариант Статическая страница, теперь выберите страницу, которую вы создали в качестве главной страницы, а другую страницу — в качестве страницы по умолчанию.',' Settings >> Reading '=>' Настройки >> Чтение ','2. Set the front page:'=>'2. Установите главную страницу:','Name it as "Home" then select the template "Custom Home Page".'=>'Назовите как "Главная", затем выберите шаблон "Пользовательская главная страница".',' Dashboard >> Pages >> Add New Page'=>' Консоль >> Страницы >> Добавить новую страницу',' Go to '=>' Перейти ','1. Create a new page :'=>'1. Создайте новую страницу:','Follow these instructions to setup Home page.'=>'Следуйте этим инструкциям, чтобы установить главную страницу.','How to set up Home Page Template'=>'Как настроить шаблон главной страницы','Footer Widget'=>'Виджет подвала','Post settings'=>'Настройки записи','Typography'=>'Типографика','Menus'=>'Меню','Footer Text'=>'Текст в подвале','Slider Section'=>'Раздел Слайдер','Upload your logo'=>'Загрузить логотип','Link to customizer'=>'Ссылка на настройку темы','Reviews'=>'Отзывы','All the features and aspects of this WordPress Theme are phenomenal. I\'d recommend this theme to all.'=>'Все свойства и аспекты этой WordPress темы феноменальны. Я бы рекомендовал эту тем