зросло, разработчики этой замечательной темы снабдили ее 100%-но отзывчивым дизайном, что позволит вам не беспокоиться о том, что вы упустите продажи, которые вы могли бы получить с помощью мобильных пользователей. Эта бесплатная тема позволяет создать собственную индивидуальность как бренда: можно загрузить логотип, поиграть с цветами, выбрать различные шрифты для своей страницы. Эта тема имеет настраиваемый дизайн, позволяющий вносить изменения по нескольким параметрам, а также интегрирована с Google Font Awesome. Самое приятное, что вам не придется писать ни одного кода для внесения необходимых изменений в макет.','Lite Theme Information'=>'Информация об облегченной теме','Support'=>'Поддержка','Get Premium'=>'Получить Премиум','Upgrade to Pro'=>'Обновить до Pro','vwpro20'=>'vwpro20','Use Coupon'=>'Использовать купон','Buy Food Grocery Store at 20% Discount'=>'Купить Food Grocery Store со скидкой 20%','All our WordPress themes are modern, minimalist, 100% responsive, seo-friendly,feature-rich, and multipurpose that best suit designers, bloggers and other professionals who are working in the creative fields.'=>'Все наши WordPress темы являются современными, минималистичными, 100% адаптивными, подготовлеными к seo, с богатым функционалом и многофункциональными, которые идеально подойдут дизайнерам, блоггерам и другим профессионалам, которые работают в области творчества.','Welcome to Food Grocery Store Theme'=>'Добро пожаловать в тему Food Grocery Store','About Food Grocery Store'=>'О Food Grocery Store','Docs'=>'Документация','Documentation'=>'Документация','Language Translator'=>'Переводчик языков','Currency Switcher'=>'Переключатель валют','By VWThemes'=>'От VWThemes','Meta'=>'Мета','Archives'=>'Архивы','Results For: %s'=>'Результаты поиска: %s','Order Tracking'=>'Отслеживание заказа','Hotline:'=>'Горячая линия:','Close Button'=>'Кнопка Закрыть','Top Menu'=>'Верхнее меню','Open Button'=>'Кнопка Открыть','shopping cart'=>'корзина','Login / Register'=>'Вход / Реги